const Home = () => {
  return (
    <section>
      <div style={{ backgroundColor: "yellow", heigth: "1.4rem" }}>
        DashBord
      </div>
      <h1 style={{ textAlign: "center", fontSize: "10px" }}>
        Welcome Admin Panel
      </h1>
    </section>
  );
};
export default Home;
